haviorData = (data) => {
    let prompts = [];
    let currentPrompt = null;
    let capturing = false;

    data.forEach(event => {
        if (event.type === "streaming_start") {
            if (currentPrompt) {
                currentPrompt.endTime = event.timestamp;
                prompts.push(currentPrompt);
            }
            capturing = true;
            currentPrompt = { startTime: null, endTime: null, content: '' };
        }

        if (capturing && event.type === "keypress") {
            if (!currentPrompt.startTime) {
                currentPrompt.startTime = event.timestamp;
            }
            currentPrompt.content += event.key;
        }

        if (event.type === "streaming_end") {
            capturing = false;
        }
    });

    return prompts;
};

const prompts = parseBehaviorData(behaviorData);
console.log(prompts);
